import React from 'react'
import './styles.css' ; 
import {Line} from 'react-chartjs-2' ; 
const App = () => {
    return (
        <React.Fragment>
        <Line
        height = {100}
        
        data = {{
            labels:["Apple" , "Orange" , "Grape" , "Pineapple"], 
        }}
        />
        </React.Fragment>
    )
}

export default App
